import React from 'react';

function Section_shop() {
	return (
		<figure id='shop'>
			<div className='pic'>
				<div className='img'></div>
				<h1>COLD BREW COFFEE</h1>
			</div>
			<div className='inner'></div>
		</figure>
	);
}

export default Section_shop;
